import React from 'react';

const MenuBox = () => {
  return (
    <div class='menu_box'>
      <img src={'./assets/img/ava1.jpg'} alt='Avatar 1' />
      <img src={process.env.PUBLIC_URL + './assets/img/ava2.jpg'} alt='Avatar 2' />
      <img src={process.env.PUBLIC_URL + './assets/img/ava3.jpg'} alt='Avatar 3' />
      <img src={process.env.PUBLIC_URL + './assets/img/blog1.jpg'} alt='Blog 1' />
      <img src={process.env.PUBLIC_URL + './assets/img/blog2.jpg'} alt='Blog 2' />
      <img src='/assets/img/ava1.jpg' alt='Avatar 1' />

    </div>
  );
};

export default MenuBox;
